DROP TABLE IF EXISTS `t_employe`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `t_employe` (
  `lg_EMPLOYE_ID` varchar(40) NOT NULL,
  `str_FIRST_NAME` varchar(100) DEFAULT NULL,
  `str_LAST_NAME` varchar(100) DEFAULT NULL,
  `str_MATRICULE` varchar(100) DEFAULT NULL,
  `str_PERSONNELPHONE` varchar(20) DEFAULT NULL,
  `str_PROFESSIONNELPHONE` varchar(20) DEFAULT NULL,
  `str_CIVILITE` varchar(20) DEFAULT NULL,
  `str_SEXE` varchar(20) DEFAULT NULL,
  `lg_MARITALSTATUS_ID` varchar(40) DEFAULT NULL,
  `int_CHILDRENNUMBER` int(2) DEFAULT '0',
  `str_EMAIL` varchar(50) DEFAULT NULL,
  `lg_MANAGER_ID` varchar(40) DEFAULT NULL,
  `dt_BIRTHDAY` datetime DEFAULT NULL,
  `lg_LEVELSTUDY_ID` varchar(40) DEFAULT NULL,
  `str_DRIVERLICENSE` tinyint(1) DEFAULT NULL,
  `str_RESPONSABLE` tinyint(1) DEFAULT NULL,
  `str_PIC` text,
  `lg_SKIN_ID` varchar(20) DEFAULT NULL,
  `dt_CREATED` datetime DEFAULT NULL,
  `dt_UPDATED` datetime DEFAULT NULL,
  `str_STATUT` varchar(20) DEFAULT NULL,
  `lg_NATIONNALITE_ID` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`lg_EMPLOYE_ID`),
  KEY `lg_LEVELSTUDY_ID` (`lg_LEVELSTUDY_ID`),
  KEY `lg_MARITALSTATUS_ID` (`lg_MARITALSTATUS_ID`),
  KEY `lg_MANAGER_ID` (`lg_MANAGER_ID`),
  KEY `lg_SKIN_ID` (`lg_SKIN_ID`),
  KEY `lg_NATIONNALITE_ID` (`lg_NATIONNALITE_ID`),
  CONSTRAINT `t_employe_fk` FOREIGN KEY (`lg_SKIN_ID`) REFERENCES `t_skin` (`lg_SKIN_ID`),
  CONSTRAINT `t_employe_fk1` FOREIGN KEY (`lg_LEVELSTUDY_ID`) REFERENCES `t_levelstudy` (`lg_LEVELSTUDY_ID`),
  CONSTRAINT `t_employe_fk2` FOREIGN KEY (`lg_NATIONNALITE_ID`) REFERENCES `t_nationnalite` (`lg_NATIONNALITE_ID`),
  CONSTRAINT `t_employe_fk4` FOREIGN KEY (`lg_MARITALSTATUS_ID`) REFERENCES `t_maritalstatus` (`lg_MARITALSTATUS_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 PACK_KEYS=0;
SET character_set_client = @saved_cs_client;

