DROP TABLE IF EXISTS `t_product`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `t_product` (
  `lg_PRODUCT_ID` varchar(40) NOT NULL,
  `dt_RECEIVED_DATE` datetime DEFAULT NULL,
  `str_NAME` varchar(100) DEFAULT NULL,
  `str_DESCRIPTION` varchar(100) DEFAULT NULL,
  `dm_PRICE` decimal(25,3) DEFAULT NULL,
  `lg_TYPEPRODUCT_ID` varchar(40) NOT NULL,
  `lg_COLOR_ID` varchar(40) NOT NULL,
  `dm_QUANTITY_RATIO` decimal(11,3) DEFAULT NULL,
  `int_DELAY_DELIVERY_DAY` int(11) DEFAULT NULL,
  `int_QUANTITY` int(11) DEFAULT NULL,
  `int_QUANTITY_MIN` int(11) DEFAULT NULL,
  `str_CREATED_BY` varchar(100) DEFAULT NULL,
  `str_UPDATED_BY` varchar(100) DEFAULT NULL,
  `dt_CREATED` datetime DEFAULT NULL,
  `dt_UPDATED` datetime DEFAULT NULL,
  `str_LINK` varchar(100) NOT NULL,
  `str_STATUT` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`lg_PRODUCT_ID`),
  KEY `lg_TYPEPRODUCT_ID` (`lg_TYPEPRODUCT_ID`),
  KEY `lg_COLOR_ID` (`lg_COLOR_ID`),
  CONSTRAINT `t_product_fk1` FOREIGN KEY (`lg_TYPEPRODUCT_ID`) REFERENCES `t_typeproduct` (`lg_TYPEPRODUCT_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `t_product_fk2` FOREIGN KEY (`lg_COLOR_ID`) REFERENCES `t_color` (`lg_COLOR_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 PACK_KEYS=0;
SET character_set_client = @saved_cs_client;

